  [],\n\t\"revision_timestamp\": \"2015-09-27T02:55:03.796510\",\n\t\"name\": \"geomagnetic-aa-indices\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The geomagnetic aa indices are the continuation
  of the series beginning in the year 1868. A full description of these indices is
  given in the International Association of Geomagnetism and Aeronomy (IAGA) Bulletin
  No 33, which contains them for the years 1868-1967. Descriptions are also given
  (especially comparisons with am, ap, or Ci indices) in two short papers [Ann. Geoph.,
  27, 62-70, 1971 and J. Geophys. Res., 77, 6870-6874, 1972]. The aa values form 1968-1975
  are contained in the IAGA Bulletin 39. From 1976 onward they are included in IAGA
  Bulletin 32. Revised aa values for the years 1969-1976 have been distributed in
  1979 to the recipients of IAGA Bulletin 32 in the form of loose sheets to be inserted
  in the Bulletin 39 (1968-1975) and 32f (1976). A graph of these values 1868 - 1979
  is published in the 426 Part I issue of Solar-Geophysical Data (SGD) (page 137).
  Revised aa values for 1968-1977 appear in the 411 Part II February 1977 SGD. Briefly,
  such three-hourly indices as these, computed from K indices of two antipodal observatories
  (invariant magnetic latitude 50 degrees), provide a quantitative characterization
  of the magnetic activity, which is homogeneous through the whole series. Half-daily
  and daily values give an estimation of the activity level very close to that obtained
  with \"am\" indices. Values are in gammas and correspond to the activity level at
  an invariant magnetic latitude of 50 degrees. The aa indices are computed for: N
  = daily values for the Northern Hemisphere, S = daily values for the Southern Hemisphere,
  M = half-daily values of aa indices for the Greenwich day. Letters C and K refer
  to a classification of the quiet days of the month (C = really quiet, K = quiet
  but with slightly disturbed three-hourly intervals). The letters on the left refer
  to the 24-hour Greenwich day, on the right to a period of 48 hours centered on the
  Greenwich noon. The three-hourly indices aa are available from the appropriate World
  Data Centers in digital form using the format described in IAGA Bulletin 33.\",\n\t\"license_title\":
